import React, { FunctionComponent } from 'react';
import './contactSection.scss';

const ContactSection : FunctionComponent = () => {
    
 return (
    <div className="row contact-row">
        <div className="col contact-col center">
            <i className="material-icons">mail</i><a href="mailto:florencejacobs85@gmail.com">florencejacobs85@gmail.com</a>
            <i className="material-icons">phone_android</i><a href="tel:+32492865800">0492 865 800</a>
        </div>
    </div>
  
 )
}
  
export default ContactSection;
